import React, { Component } from "react";
import ServiceList from "./ServiceList";

export default class Home extends Component {
  render() {
    return (
      <div>
        <div className="container-fluid border">
          {/* Header section */}
          <div className="bg-primary" style={{ height: "500px" }}>
            <div className="bg-dark text-center py-3">
              <h1 className="text-white">Book My Clean</h1>
            </div>

            <div
              className="bg-light d-flex justify-content-center align-items-center"
              style={{ height: "400px" }}
            >
              <img
                src="https://drive.google.com/uc?export=view&id=1xLmzOi2bUU3P-shxKZ8o5XF0VI9vxbzW"
                alt="Book My Clean"
                style={{
                  maxWidth: "90%",
                  height: "auto",
                  borderRadius: "10px",
                }}
              />
            </div>
          </div>
        </div>

        <ServiceList />

        <div className="container border" style={{ height: "1000px" }}></div>
      </div>
    );
  }
}
